package com.cedarhd.models;

public class 钻石收发记录 {
	public int 编号;
	public int 发放人;
	public int 接收人;
	public String 时间;
	public int 数据编号;
	public int 数据类型;
	public int 数量;
	public int 之前数量;
	public int 之后数量;
	public String 发放人姓名;
	public String 接收人姓名;
	public int 类型;
	public 钻石收发记录() {
		// TODO Auto-generated constructor stub
	}
	public 钻石收发记录(int 编号, int 发放人, int 接收人, String 时间, int 数据编号, int 数据类型,
			int 数量, int 之前数量, int 之后数量,String 发放人姓名,String 接收人姓名,int 类型) {
		super();
		this.编号 = 编号;
		this.发放人 = 发放人;
		this.接收人 = 接收人;
		this.时间 = 时间;
		this.数据编号 = 数据编号;
		this.数据类型 = 数据类型;
		this.数量 = 数量;
		this.之前数量 = 之前数量;
		this.之后数量 = 之后数量;
		this.接收人姓名=接收人姓名;
		this.发放人姓名=发放人姓名;
		this.类型=类型;
				
	}
	@Override
	public String toString() {
		// TODO Auto-generated method stub
		return 时间+","+发放人姓名+","+接收人姓名;
	}
}
